import React from 'react'
import logoIcon from './images/logo-icon.png'
import lightLogo from './images/logo-light-text.png'
import lightIcon from './images/logo-light-icon.png'
import user from './images/orgxtopaz.png'
import './css/custom.css';
function Profile() {
  return (


    <div>
    {/* ============================================================== */}
    {/* Preloader - style you can find in spinners.css */}
    {/* ============================================================== */}
    <div className="preloader">
      <div className="lds-ripple">
        <div className="lds-pos" />
        <div className="lds-pos" />
      </div>
    </div>
    {/* ============================================================== */}
    {/* Main wrapper - style you can find in pages.scss */}
    {/* ============================================================== */}
    <div id="main-wrapper" data-layout="vertical" data-navbarbg="skin5" data-sidebartype="full" data-sidebar-position="absolute" data-header-position="absolute" data-boxed-layout="full">
      {/* ============================================================== */}
      {/* Topbar header - style you can find in pages.scss */}
      {/* ============================================================== */}
      <header className="topbar" data-navbarbg="skin5">
        <nav className="navbar top-navbar navbar-expand-md navbar-dark">
          <div className="navbar-header" data-logobg="skin5">
            {/* ============================================================== */}
            {/* Logo */}
            {/* ============================================================== */}
            <a className="navbar-brand" href="/">
              {/* Logo icon */}
              <b className="logo-icon">
                {/* Dark Logo icon */}
                <img src="https://i.scdn.co/image/ab6761610000e5ebc02d416c309a68b04dc94576" alt="homepage" className="dark-logo" />
                {/* Light Logo icon */}
                <img src={lightIcon} alt="homepage" className="light-logo" />
              </b>
              {/*End Logo icon */}
              {/* Logo text */}
              <span className="logo-text">
                {/* dark Logo text */}
                <img src={logoIcon}alt="homepage" className="dark-logo" />
                {/* Light Logo text */}
                {/* <img src={lightLogo} className="light-logo" alt="homepage" /> */}
              </span>
            </a>
            {/* ============================================================== */}
            {/* End Logo */}
            {/* ============================================================== */}
            {/* This is for the sidebar toggle which is visible on mobile only */}
            <a className="nav-toggler waves-effect waves-light d-block d-md-none" href="javascript:void(0)"><i className="ti-menu ti-close" /></a>
          </div>
          {/* ============================================================== */}
          {/* End Logo */}
          {/* ============================================================== */}
          <div className="navbar-collapse collapse" id="navbarSupportedContent" data-navbarbg="skin5">
            {/* ============================================================== */}
            {/* toggle and nav items */}
            {/* ============================================================== */}
          
            {/* ============================================================== */}
            {/* Right side toggle and nav items */}
            {/* ============================================================== */}
           
          </div>
        </nav>
      </header>
      {/* ============================================================== */}
      {/* End Topbar header */}
      {/* ============================================================== */}
      {/* ============================================================== */}
      {/* Left Sidebar - style you can find in sidebar.scss  */}
      {/* ============================================================== */}
      <aside className="left-sidebar" data-sidebarbg="skin6">
        {/* Sidebar scroll*/}
        <div className="scroll-sidebar">
          {/* Sidebar navigation*/}
          <nav className="sidebar-nav">
            <ul id="sidebarnav">
              {/* User Profile*/}
              <li>
                {/* User Profile*/}
                <div className="user-profile d-flex no-block dropdown m-t-20">
                  <div className="user-pic"><img src={user} alt="users" className="rounded-circle" width={40} /></div>
                  <div className="user-content hide-menu m-l-10">
                    <a href="#" className id="Userdd" role="button" data-bs-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                      <h5 className="m-b-0 user-name font-medium">Orgxtopaz <i className="fa fa-angle-down" /></h5>
                      <span className="op-5 user-email">orgxtopaz@gmail.com</span>
                    </a>
                    <div className="dropdown-menu dropdown-menu-end" aria-labelledby="Userdd">
                      <a className="dropdown-item" href="javascript:void(0)"><i className="ti-user m-r-5 m-l-5" /> My Profile</a>
                      <a className="dropdown-item" href="/adminInbox"><i className="ti-email m-r-5 m-l-5" /> Inbox</a>
                      
                      <a className="dropdown-item" href="javascript:void(0)"><i className="fa fa-power-off m-r-5 m-l-5" /> Logout</a>
                    </div>
                  </div>
                </div>
                {/* End User Profile*/}
              </li>
      
              {/* User Profile*/}
              <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="/adminHome" aria-expanded="false"><i className="mdi mdi-view-dashboard" /><span className="hide-menu">Dashboard</span></a></li>
              <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="/adminPosts" aria-expanded="false"><i className="mdi mdi-newspaper" /><span className="hide-menu">Posts</span></a></li>
              <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="/seeRequests" aria-expanded="false"><i className="mdi mdi-border-all" /><span className="hide-menu">Customer's Requests</span></a></li>

           
            </ul>
          </nav>
          {/* End Sidebar navigation */}
        </div>
        {/* End Sidebar scroll*/}
      </aside>

      <div className="page-wrapper">
{/* ============================================================== */}
{/* Bread crumb and right sidebar toggle */}
{/* ============================================================== */}
<div className="page-breadcrumb">
  <div className="row align-items-center">
    <div className="col-5">
     

      <div className="d-flex align-items-center">
        <nav aria-label="breadcrumb">
          <ol className="breadcrumb">
            <li className="breadcrumb-item"><a href="/adminHome">Dashboard</a></li>
            <li className="breadcrumb-item active" aria-current="page">Profile</li>
          </ol>
        </nav>
      </div>
    </div>
   
  </div>
</div>
{/* ============================================================== */}
{/* End Bread crumb and right sidebar toggle */}
{/* ============================================================== */}
{/* ============================================================== */}
{/* Container fluid  */}
{/* ============================================================== */}
<div className="container-fluid">
<div className="row">
        {/* Column */}
        <div className="col-lg-4 col-xlg-3 col-md-5">
          <div className="card">
            <div className="card-body">
              <center className="m-t-30"> <img src={user} className="rounded-circle" width={150} />
                <h4 className="card-title m-t-10">John Miguel</h4>
                <h6 className="card-subtitle">System Admin</h6>
                
              </center>
            </div>
            <div>
              <hr />
            </div>
            <div className="card-body"> <small className="text-muted">Email address </small>
              <h6>xjohnmiguelestopaz@gmail.com</h6> <small className="text-muted p-t-30 db">Phone</small>
              <h6>+91 654 784 547</h6> <small className="text-muted p-t-30 db">Address</small>
              <h6>Cebu City, Cebu</h6>
              <div className="map-box">
                <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d991273.1774770138!2d123.11343063842597!3d10.059499154936741!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x33a999258dcd2dfd%3A0x4c34030cdbd33507!2sCebu%20City%2C%20Cebu!5e0!3m2!1sen!2sph!4v1651050850673!5m2!1sen!2sph"  frameBorder={0} style={{border: 0,width:"80%"}} allowFullScreen />
              </div> <small className="text-muted p-t-30 db">Social Profile</small>
              <br />
              <button className="btn btn-circle btn-secondary"><i className="fab fa-facebook-f" /></button>
              <button className="btn btn-circle btn-secondary"><i className="fab fa-twitter" /></button>
              <button className="btn btn-circle btn-secondary"><i className="fab fa-youtube" /></button>
            </div>
          </div>
        </div>
        {/* Column */}
        {/* Column */}
        <div className="col-lg-8 col-xlg-9 col-md-7">
          <div className="card">
            <div className="card-body">
              <form className="form-horizontal form-material mx-2">
                <div className="form-group">
                  <label className="col-md-12">Full Name</label>
                  <div className="col-md-12">
                    <input type="text" placeholder="orgxtopaz" className="form-control form-control-line" />
                  </div>
                </div>
                <div className="form-group">
                  <label htmlFor="example-email" className="col-md-12">Email</label>
                  <div className="col-md-12">
                    <input type="email" placeholder="xjohnmiguelestopaz@admin.com" className="form-control form-control-line" name="example-email" id="example-email" />
                  </div>
                </div>
                <div className="form-group">
                  <label className="col-md-12">Password</label>
                  <div className="col-md-12">
                    <input type="password" defaultValue="password" className="form-control form-control-line" />
                  </div>
                </div>
                <div className="form-group">
                  <label className="col-md-12">Phone No</label>
                  <div className="col-md-12">
                    <input type="text" placeholder="123 456 7890" className="form-control form-control-line" />
                  </div>
                </div>
              
                <div className="form-group">
                  <label className="col-sm-12">Select Country</label>
                  <div className="col-sm-12">
                    <select className="form-select shadow-none form-control-line">
                      <option>London</option>
                      <option>India</option>
                      <option>Usa</option>
                      <option>Canada</option>
                      <option>Thailand</option>
                    </select>
                  </div>
                </div>
                <div className="form-group">
                  <div className="col-sm-12">
                    <button className="btn btn-success text-white">Update Profile</button>
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
        {/* Column */}
      </div>
 
</div>
{/* ============================================================== */}
{/* End Container fluid  */}
{/* ============================================================== */}
{/* ============================================================== */}
{/* footer */}
{/* ============================================================== */}
<footer className="footer text-center">
          All Rights Reserved by Orgxtopaz. Designed and Developed by <a href="https://www.fiverr.com/orgxtopaz">Orgxtopaz</a>.
        </footer>
{/* ============================================================== */}
{/* End footer */}
{/* ============================================================== */}
</div>
 
    </div>
  </div>
   
    
  )
}

export default Profile
